import React from "react";
import "../Style.css";

const Login = () => {
  return (
    <div className="auth-page">
      <h1>Se connecter</h1>
      <form>
        <input type="email" placeholder="Email" required />
        <input type="password" placeholder="Mot de passe" required />
        <button type="submit">Connexion</button>
      </form>
    </div>
  );
};

export default Login;
